import React, { useState,useEffect } from 'react'
import axios from 'axios';

import './App.css'


const TableBooking = () => {
const [booking,setBooking] = useState([])
const [room_meeting, setRoomMeeting] = useState([])
const [employees, setEmployees] = useState([])

// useEffect(async () => {
//     try {
//         const response = await axios.get('https://3b33-2402-800-6235-73aa-987f-bbbf-be44-2572.ngrok-free.app//booking',
//             {
//                 headers: {
//                     "Accept": 'application/json',
//                     'ngrok-skip-browser-warning': 'any',
//                     "Content-Type": "application/x-www-form-urlencoded",
//                     "Access-Control-Allow-Origin": "*",
//                 },
//                 withCredentials: true
//             }
//         )
//         console.log(response.data.booking);
//         setBooking(response.data.booking);
//         console.log(booking);
//     } catch (error) {
//     }
// }, []);
const fetchBooking = async () => {

    try {
        const response = await axios.get('https://3b33-2402-800-6235-73aa-987f-bbbf-be44-2572.ngrok-free.app//bookings',
            {
                headers: {
                    "Accept": 'application/json',
                    'ngrok-skip-browser-warning': 'any',
                    "Content-Type": "application/x-www-form-urlencoded",
                    "Access-Control-Allow-Origin": "*",
                },
                withCredentials: true
            }
        )
        console.log(response.data.booking);
        setBooking(response.data.booking);
        console.log(booking);
    } catch (error) {
    }
}

useEffect(() => {
    fetchBooking()
}, []);
  return (
    <div>
      <div className='container'>
        <table>
            <thead>
                <tr>
                    <th>STT</th>
                    <th>Room Name</th>
                    <th>Start Time</th>
                    <th>End Time</th>
                    <th>Employee</th>
                </tr>
            </thead>
            <tbody>
                {booking.map((book, key )=>{
                    return(
                        <tr key={book.booking_id}>
                            <td>{book.booking_id}</td>

                        </tr>
                    )
                })}


            </tbody>
        </table>
      </div>
    </div>
  )
}

export default TableBooking
